import re

def parseForm(html: str) -> dict:
    form_data = {'': '', 'inputs': {}}
    action_match = re.search('<form.*?action="(.*?)"', html)
    if action_match:
        form_data['action'] = action_match.group(1)
    input_matches = re.findall('<input.*?name="(.*?)".*?value="(.*?)"', html)
    for (name, value) in input_matches:
        form_data['inputs'][name] = value
    return form_data

